description:
Veel heeft ze niet van haar moeder geerfd, maar wel een grenzelolze haat jegens een groep mannen en de smeekbede hen te doden. Kort in het nieuwe jaar worden in Maardam twee mannen vermoord aangetrofen. Ze zijn in de borst geraakt en bovendien is hun onderlijf weggeschoten. 

Commissaris Van Veeteren heeft nauwelijks aanknopingspunten. Vast staat alleen dat er 1 dader aan het werk geweest is, vermoedelijk een vrouw die in haar eer is aangetast. Een theorie die Van Veeteren geen stap vooruit brengt. 




